import React from "react";

import { FaUserAlt } from "react-icons/fa";
import { IoLocationSharp } from "react-icons/io5";

const colors = ["green", "yellow", "red", "blue", "indigo", "purple", "pink"];

export default function CalendarItem(props) {
  let color = colors[props.id];
  return (
    <div
      className={
        "absolute bg-" +
        color +
        "-300 border-l-2 border-" +
        color +
        "-600 text-" +
        color +
        "-600"
      }
    >
      <h3>{props.title}</h3>
      <h4>
        <span>
          <FaUserAlt />
          {props.professor}
        </span>
      </h4>
      <h4>
        <span>
          <IoLocationSharp />
          {props.location}
        </span>
      </h4>
    </div>
  );
}
